import React from 'react';

const Cafe = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'Right',
		alignItems: 'Right',
		height: '100vh'
	}}
	>
	<h1>Our menu</h1>
	<table>
		<tr>
			<td>Apple strudel</td>
			<td>7.50</td>
		</tr>
	</table>
	</div>
);
};

export default Cafe;
